DESCRIPTION:
Laba diena,

Justiniškėse prie parduotuvės IKI (Rygos g. 41) ir šalia gyvenamųjų namų jau senokai sumontuoti metaliniai kioskai, kurie jokios pridėtinės vertės rajono gyventojams neatneša. Čia nuolat vyksta neblaivių asmenų &#34;pasisėdėjimai&#34;, išgėrinėjimai, trikdoma gyventojų ramybė, taip pat neužtikrinama viešoji tvarka bei elementarios higienos sąlygos. 

Vos vienas ar du kioskeliai išnuomoti ir kartais vykdo veiklą, o visa kita labiau panašu į šiukšlyną: nuolat mėtosi alkoholinės taros tušti buteliai, šiukšlės, purvini rūbai, batai ir kt.

Prašau:
- išspręsti klausimą dėl viešosios tvarkos, švaros bei ramybės gyventojams užtikrinimo;
- informuoti prekybvietės savininką, jog būtų užtikrinta tinkamą prekybos vietų priežiūra bei švara;
- spęsti klausimą dėl tokios prekybos vietos poreikio Justiniškių rajone, kuri neatneša jokios naudos, o tik teršia rajoną bei trikdo gyventojų ramybę;
- spręsti pasiūlymą šią vietą apsodinti medžiais ir įrengti žaliąją zoną.

Pagarbiai
Meida Marozaitė.

